import { Pipe, PipeTransform } from '@angular/core';
import { isObservable, of, Observable } from 'rxjs';
import { map, startWith, catchError } from 'rxjs/operators';

@Pipe({
  name: 'asyncLoading',
})
export class AsyncLoading implements PipeTransform {
  
  transform<T>(obj: Observable<T>): Observable<{loading: boolean, value?:T, error?: any}>;
  transform(val: Observable<any>): any {
    return isObservable(val)
      ? val.pipe(
        map(value => ({ loading: false, value })),
        startWith({ loading: true }),
        catchError(error => of({ loading: false, error }))
      )
      : val;
  }
}

import { Pipe, PipeTransform } from '@angular/core';
import { isObservable, of, Observable } from 'rxjs';
import { map, startWith, catchError } from 'rxjs/operators';

@Pipe({
  name: 'ellipsis',
})
export class EllipsisPipe implements PipeTransform {

  transform(val: string, size: number): any {
    if (val.length > size) {
      return val.substring(0, size - 3) + '...';
    }
    return val;
  }
}

import { Pipe, PipeTransform } from '@angular/core';
import { JobModel } from './job-list.models';

@Pipe({ name: 'filterByDescription'})
export class FilterByDescription implements PipeTransform {

    transform(photos: JobModel[], descriptionQuery: string) {
        descriptionQuery = descriptionQuery
            .trim()
            .toLowerCase();

        if(descriptionQuery) {
            return photos.filter(photo =>
                photo.description.toLowerCase().includes(descriptionQuery)
            );
        } else {
            return photos;
        }
    }
}

import { Pipe, PipeTransform } from '@angular/core';
import { JobModel } from './job-list/job-list.models';

@Pipe({ name: 'filterByJob'})
export class FilterByJob implements PipeTransform {

    transform(jobs: JobModel[], descriptionQuery: string) {
        descriptionQuery = descriptionQuery
            .trim()
            .toLowerCase();

        if(descriptionQuery) {
            return jobs.filter( job=>
                job.title.toLowerCase().includes(descriptionQuery)
            );
        } else {
            return jobs;
        }
    }
}

