import { BrowserModule } from '@angular/platform-browser';
import { NgModule } from '@angular/core';

import { AppComponent } from './app.component';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';
import { SharedModule } from 'src/app/shared.module';
import { AppRoutingModule } from './app.routing.module';
import { DashboardComponent } from './dashboard/dashboard.component';
import { HomeModule } from './home/home.module';
import { HomeLoginModule } from './login-home/home-login.module';
import { NewJobModule } from './new-job/new-job.module';
import { HTTP_INTERCEPTORS } from '@angular/common/http';
import { TokenInterceptor } from './token-interceptor';
import { NewCompanyModule } from './new-company/new-company.module';
import { CurrencyMaskInputMode, NgxCurrencyModule } from 'ngx-currency';
import { RegistrationsModule } from './registrations/registrations.module';

export const customCurrencyMaskConfig = {
  align: "left",
  allowNegative: false,
  allowZero: false,
  decimal: ",",
  precision: 2,
  prefix: "R$ ",
  suffix: "",
  thousands: ".",
  nullable: true,
  inputMode: CurrencyMaskInputMode.FINANCIAL
};

@NgModule({
  declarations: [
    DashboardComponent,
    AppComponent,
  ],
  imports: [
    AppRoutingModule,
    SharedModule,
    BrowserModule,
    HomeModule,
    HomeLoginModule,
    BrowserAnimationsModule,
    NewJobModule,
    NewCompanyModule,
    RegistrationsModule,
    NgxCurrencyModule.forRoot(customCurrencyMaskConfig)
  ],
  providers: [{
    provide: HTTP_INTERCEPTORS,
    useClass: TokenInterceptor,
    multi: true
  },],
  bootstrap: [AppComponent]
})
export class AppModule { }

import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { HomeComponent } from './home/home.component';
import { DashboardComponent } from './dashboard/dashboard.component';
import { LoginComponent } from './login-home/signin/login.component';
import { SignupComponent } from './login-home/signup/signup.component';
import { NewJobComponent } from './new-job/new-job.component';
import { ResetPasswordComponent } from './login-home/reset-password/reset-password';
import { NewPasswordComponent } from './login-home/new-senha/new-password';
import { NewCompanyComponent } from './new-company/new-company.component';
import { RegistrationsComponent } from './registrations/registrations.component';
import { LoggedGuard } from './login-home/logged.guard';

const routes: Routes = [
  { path: 'home',
   component: HomeComponent,
    data: { showSideMenu: true },
   canActivate: [LoggedGuard],
  },
  { path: 'register',
   component: SignupComponent,
  data: { showSideMenu: false },

  },
  { path: 'newjob',
   component: NewJobComponent,
   data: {showSideMenu:true},
   canActivate: [LoggedGuard],
  },
  { path: 'resetpassword',
   component: ResetPasswordComponent,
   data: {showSideMenu:false}
  },
  { path: '',
  component: LoginComponent,
  data: {showSideMenu:false}
  },
  { path: 'reset-password',
  component: NewPasswordComponent,
  data: {showSideMenu:false}
  },
  { path: 'newcompany',
  component: NewCompanyComponent,
  data: {showSideMenu:true},
  canActivate: [LoggedGuard],
  },
  { path: 'myregister',
  component: RegistrationsComponent,
  data: {showSideMenu:true},
  canActivate: [LoggedGuard],
  },
  { path: 'dashboard', component: DashboardComponent },
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule {}

